import Grass from "./Grass";
import {useEffect, useRef} from "react";

function ObjectCreatorGrass({ objectIndex }) {
    const ObjectCreatorGrassRef = useRef(null);

    useEffect(() => {
        const ObjectCreatorGrassElement = ObjectCreatorGrassRef.current;
        if (ObjectCreatorGrassElement) {
            const { width, height } = ObjectCreatorGrassElement.getBoundingClientRect();
            console.log("Размер ObjectCreator:", width);
        }
    }, []);
    if (objectIndex >= 0 && objectIndex <= 99) {
        return <Grass ref={ObjectCreatorGrassRef} />;
    } else {
        return null;
    }
}

export default ObjectCreatorGrass;
